                              sx={{
                                color: "white",
                                marginRight: "8px",
                              }}
                            />
                          ),
                          style: {
                            borderRadius: "5px",
                            background: "rgba(255, 255, 255, 0.12)",
                            paddingRight: "18px",
                            fontSize: "17px",
                          },
                          inputProps: {
                            style: {
                              color: "white",
                            },
                          },
                        }}
                        InputLabelProps={{
                          style: {
                            color: "white",
